#include <bits/stdc++.h>

using namespace std;

int main(){
  class Solution {
  public:
    string minWindow(string s, string t) {
      if (t.length() > s.length()) {
        return "";
      } 

      unordered_map<char, long> requiredCharDict;
      
      
      for (int i = 0; i < t.length(); i++) {
        if (requiredCharDict.count(t[i])) {
          requiredCharDict[t[i]]++;
        } else {
          requiredCharDict[t[i]] = 1;
        }
      }

      
      std::cout << requiredCharDict.bucket_count() << ", " << requiredCharDict.size();

      string res = "";
      int min = s.length();

      int p1 = 0;
      int p2 = 0;
      int unfulfilled = t.length();
      while (p2 < s.length()) {
        if (unfulfilled == 0) {
          if (p2 - p1 < min) {
            res = s.substr(p1, p2 - p1);
            min = p2 - p1;
          }
          if (requiredCharDict.count(s[p1])) {
            requiredCharDict[s[p1]]++;
            if (requiredCharDict[s[p1]] > 0) {
              unfulfilled++;
            }
          }

          p1++;
        } else {

          if (requiredCharDict.count(s[p2])) {
            requiredCharDict[s[p2]]--;
            if (requiredCharDict[s[p2]] >= 0) {
              unfulfilled--;
            }
          }


          p2++;
        }
      }

      std::cout << requiredCharDict.bucket_count() << ", " << requiredCharDict.size();

      if (unfulfilled == 0) {


        while (p1 < p2 && unfulfilled == 0) {
          if (p2 - p1 <= min) {
            res = s.substr(p1, p2 - p1);
            min = p2 - p1;
          }

          if (requiredCharDict.count(s[p1])) {
            requiredCharDict[s[p1]]++;
            if (requiredCharDict[s[p1]] > 0) {
              return res;
            }
          }

          p1++;
        }
      }

      return res;
    }
  };

  Solution s;
  std::cout << s.minWindow("", "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ");
  return 0;
}